%[text] # Zadatak 1:
load T_data_matrix_input.mat
T_data_matrix_input;

%[text] ## Data transformation
% tabela prebacena u matricu radi matematickih operacija.
T_modified = T_data_matrix_input{:, :};

% Treci koren za immunity_proxy, boosters, older pop, diabetes
T_modified(:, [1,3,7,9]) = nthroot(T_modified(:, [1,3,7,9]),3);


% transformacija kolona fully vacc i HDI
T_modified(:, [2,10]) = -sqrt((max(T_modified(:, [2,10]))-T_modified(:, [2,10])));

% logaritam gustine populacije, cardiovasc, R_avg
T_modified(:, [5,8,18]) = log(T_modified(:, [5,8,18]));

% transformacija mobility retail, mobility grocery
T_modified(:, [11,12]) = log(T_modified(:, [11,12]) - min(T_modified(:, [11,12])));

% transformacija mobility parks, mobility transit
T_modified(:, [13,14]) = nthroot((T_modified(:, [13,14])-min(T_modified(:, [13,14]))), 3);

% kvadriranje median age
T_modified(:, 6) = T_modified(:, 3).^2;

% transformacija mobility workplace
T_modified(:, 15) = sqrt((T_modified(:, 15)-min(T_modified(:,15))));

% transformacija mobility residential
T_modified(:, 16) = nthroot(-(max(T_modified(:,16))-T_modified(:,16)),3);

%[text] ## Detekcija outliera i zamena istih medianom
matrica_bez_autlajera = DnRoutlier(T_modified);
tablea_bez_autlajera = array2table(matrica_bez_autlajera, "VariableNames", ... %[output:group:9a7837a2] %[output:1f19d19f]
    {'immunity proxy', ... %[output:1f19d19f]
    'fully vaccinated', ... %[output:1f19d19f]
    'boosters', ... %[output:1f19d19f]
    'stringency', ... %[output:1f19d19f]
    'pop. density', ... %[output:1f19d19f]
    'median age', ... %[output:1f19d19f]
    'older population', ... %[output:1f19d19f]
    'cardiovasc', ... %[output:1f19d19f]
    'diabetes', ... %[output:1f19d19f]
    'HDI', ... %[output:1f19d19f]
    'mobility retail', ... %[output:1f19d19f]
    'mobility grocery', ... %[output:1f19d19f]
    'mobility park', ... %[output:1f19d19f]
    'mobility transit', ... %[output:1f19d19f]
    'mobility workplace', ... %[output:1f19d19f]
    'mobility residential', ... %[output:1f19d19f]
    'onset', ... %[output:1f19d19f]
    'R_avg'}); %[output:group:9a7837a2] %[output:1f19d19f]

%[text] ## Formiranje korelacione matrice
[corr_coeffs, p_values] = corr(matrica_bez_autlajera);
predictors = {'immunity proxy', 'fully vaccinated', 'boosters','stringency','pop. density', 'median age', 'older population', 'cardiovasc', 'diabetes','HDI', 'mobility retail', 'mobility grocery', 'mobility park', 'mobility transit','mobility workplace', 'mobility residential', 'onset', 'R_avg'};

% p_values_bitne = cell(size(p_values));
% for i = 1:size(p_values,1)
%     for j = 1:size(p_values,2)
%         if p_values(i,j) < 0.001
%             p_values_bitne{i,j} = '***';
%         elseif p_values(i,j) < 0.01
%             p_values_bitne{i,j} = '**';
%         elseif p_values(i,j) < 0.05
%             p_values_bitne{i,j} = '*';
%         else
%             p_values_bitne{i,j} = '';
%         end
%     end
% end
figure('Position', [100, 100, 1200, 900]); %[output:0d4611f4]
h = heatmap(predictors, predictors, corr_coeffs) %[output:35bdb5d5] %[output:0d4611f4]
h.ColorLimits = [-1 1] %[output:9a1abb5f] %[output:0d4611f4]
h.Colormap = flipud(redbluecmap) %[output:2700d67a] %[output:0d4611f4]

% h.CellLabelData = p_values_bitne; Nisam uspeo da nadjem ni jedan
% nezastareli(da nije out of use) nacin da stavim p_values na pojedinacne celije
% heatmapa

%[text] ## Scatter plot paneli
R0 = matrica_bez_autlajera(:,18);
% posebni plotovi
posebni_plotovi = [1,4,5,10,17];
for i = 1:length(posebni_plotovi)
    idx = posebni_plotovi(i);
    figure;
    scatter(matrica_bez_autlajera(:, idx), R0, 'filled');
    lsline;
    title(sprintf('R = %.2f, P = %.4f', corr_coeffs(idx,18), p_values(idx,18)));
    xlabel(predictors(idx))
    ylabel('R0')
end
% paneli 1x2
paneli_a = {[2 3], [6 7], [8 9]};
for i = 1:length(paneli_a)
    figure;
    for j = 1:2
        subplot(1,2,j)
        scatter(matrica_bez_autlajera(:, paneli_a{i}(j)), R0, 'filled');
        lsline;
        title(sprintf('R = %.2f, P = %.4f', corr_coeffs(paneli_a{i}(j),18), p_values(paneli_a{i}(j),18)));
        xlabel(predictors{paneli_a{i}(j)})
        ylabel('R0')
    end
end

% panel 2x3
mobility_idxs = 11:16;
figure;
for i = 1:length(mobility_idxs)
    idx = mobility_idxs(i);
    subplot(2,3,i)
    scatter(matrica_bez_autlajera(:,idx), R0, 'filled')
    lsline;
    title(sprintf('R = %.2f, P = %.4f', corr_coeffs(idx, 18), p_values(idx,18)))
    xlabel(predictors(idx))
    ylabel('R0')
end


